import './App.css';
import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import Header from '../Header/Header';

function App() {
  return (
    <div className='body'>
      <div className='page'>
      <Header />
      <Routes>
            <Route
              path="/signup"
            />
            <Route
              path="/signin"
            />
          </Routes>
      </div>
    </div>
  );
}

export default App;
